@use 'abstracts/' as *;


.nav-bar {
    opacity: 1;
    position: fixed;
    top: -4rem;
    left: 0;
    z-index: 999;
    background-color: $black;
    width: 100%;
    color: $white;
    display: flex;
    justify-content: space-between;
    align-items: center;
    height: 4rem;
    padding: 0 40px;
    border-bottom: 1px solid rgba(255, 255, 255, 0.414);
    transition: all .5s;

    a {
        height: 4rem;
        line-height: 4rem;
        vertical-align: center;
        text-decoration: none;
        color: $white;
        .logo {
            width: 100%;
            height: 4rem;
            line-height: 4rem;
            vertical-align: center;
            font-size: $heading;
            letter-spacing: -.1rem;
            font-weight: 800;
            color: $yellow;
        }
    }

    .nav-links {
        list-style: none;

        li {
            float: left;
            font-size: $regular;
            overflow: hidden;


            &:not(:last-child) {
                margin-right: 2rem;
            }

            a {
                color: $white;
                text-decoration: none;
                position: relative;

                &::before {
                    content: "";
                    position: absolute;
                    width: 100%;
                    height: .1rem;
                    background-color: white;
                    bottom: 0;
                    transform-origin: right;
                    transform: scaleX(0);
                    transition: transform .3s;
                    }

                &:hover::before {
                    transform: scaleX(1);
                    transform-origin: left;
                    
                }

                
            }
        }

    }
}

