@use 'abstracts/' as *;

.welcome {
    background-image: $background-home;
    background-size: cover;
    background-position: center center;
    background-repeat: no-repeat;
    color: $white;
    width: 100%;
    text-align: center;
    height: 60vh;
    padding-top: 3rem;
    overflow: hidden;
    margin-bottom: 0;

    &__caption {
        font-size: $title;
        letter-spacing: -7px;
        font-weight: 800;
        user-select: none;
    }

    &__description {
        font-size: $heading;
        font-weight: 300;
        margin-top: -3rem;
    }

    &__text {
        font-size: $regular;
        font-weight: 300;
        width: 40rem;
        margin-left: auto;
        margin-right: auto;
        margin-top: -.5rem;
    }
    
    &__button {
        background-color: $yellow;
        @include button-style;
        margin-left: auto;
        margin-right: auto;
        margin-top: 2rem;
        width: 300px;
        height: 55px;
        


        &::before {
            content: "";
            position: absolute;
            width: 100%;
            height: 100%;
            border-radius: 40px;
            background-color: $black;
            z-index: 0;
            transform: scaleX(0);
            transform-origin: right;
            transition: transform .6s;

        }

        &:hover::before {
            transform-origin: left;
            transform: scaleX(1);
        }

        a {
            @include button-text;
            color: $black;
            text-transform: uppercase;
            font-weight: 800;
            font-size: $button-font;
            transition: all .6s;


            &:hover {
                color: $white;
            }
            
        }
        
    }
